import "./ExpenseItem.css";
function ExpenseItem() {
  return (
    <div className="expense-item">
      <div className="expense-item__description">March 18th 2024</div>
      <div>
        <h2>Car insurance</h2>
        <div className="expense-">$180</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
